            string OutputString = "lvls={\n";

            foreach (string MapPath in MapPaths)
            {
                OutputString += "{\n";

                TmxMap Map = new TmxMap(MapPath);

                int ActiveTileCount = 0;

                int ActiveTile = -1;

                // Index is left tile, value is all the tiles that appear to the right of it.
                List<Tuple<TmxLayerTile, TmxLayerTile, TmxLayerTile, TmxLayerTile>> LookupTable =
                    new List<Tuple<TmxLayerTile, TmxLayerTile, TmxLayerTile, TmxLayerTile>>();

                TmxLayer BackgroundLayer = Map.Layers["Background"];

                OutputString += "w=" + Map.Width + ",\n";
                OutputString += "h=" + Map.Height + ",\n";

                if (Map.Properties.ContainsKey("Pal") && Map.Properties["Pal"] != "0")
                {
                    OutputString += "pal=" + Map.Properties["Pal"] + ",\n";
                }
                if (Map.Properties.ContainsKey("Clear") && Map.Properties["Clear"] != "0")
                {
                    OutputString += "cls=" + Map.Properties["Clear"] + ",\n";
                }
                if (Map.Properties.ContainsKey("Music") && Map.Properties["Music"] != "0")
                {
                    OutputString += "mus=" + Map.Properties["Music"] + ",\n";
                }

                OutputString += "bg=\"";

                for (int i = 0; i < BackgroundLayer.Tiles.Count; i += 2)
                //            for (int i = 0; i < lvl.Length; i++)
                {
                    if (i != 0 && i % Map.Width == 0)
                    {
                        i += Map.Width;
                        if (i >= BackgroundLayer.Tiles.Count)
                        {
                            break;
                        }
                    }

                    int LookupId = -1;
                    TmxLayerTile Tile = BackgroundLayer.Tiles[i];
                    for (int j = 0; j < LookupTable.Count; j++)
                    {
                        if (LookupTable[j].Item1.Gid == Tile.Gid &&
                            LookupTable[j].Item2.Gid == BackgroundLayer.Tiles[i + 1].Gid &&
                            LookupTable[j].Item3.Gid == BackgroundLayer.Tiles[i + Map.Width].Gid &&
                            LookupTable[j].Item4.Gid == BackgroundLayer.Tiles[i + 1 + Map.Width].Gid)
                        {
                            LookupId = j;
                            break;
                        }
                    }

                    if (LookupId == -1)
                    {
                        LookupTable.Add(new Tuple<TmxLayerTile, TmxLayerTile, TmxLayerTile, TmxLayerTile>(
                            Tile, BackgroundLayer.Tiles[i + 1],
                            BackgroundLayer.Tiles[i + Map.Width], BackgroundLayer.Tiles[i + 1 + Map.Width]));
                        LookupId = LookupTable.Count - 1;
                    }

                    if (ActiveTile == LookupId)
                    {
                        ActiveTileCount += 1;
                        //handle case where we max out hex value

                        if (ActiveTileCount >= 255)
                        {
                            OutputString += num2hex(ActiveTileCount);
                            OutputString += num2hex(ActiveTile);

                            ActiveTileCount = 0;
                        }
                    }
                    else
                    {
                        //log the old tile info
                        if (ActiveTileCount > 0)
                        {
                            OutputString += num2hex(ActiveTileCount);
                            OutputString += num2hex(ActiveTile);

                        }

                        // start a new counter
                        ActiveTileCount = 1;
                        ActiveTile = LookupId;
                    }
                }

                //log the old tile info
                if (ActiveTileCount > 0)
                {
                    OutputString += num2hex(ActiveTileCount);
                    OutputString += num2hex(ActiveTile);

                }

                OutputString += "\",\nlookup=\"";

                for (int i = 0; i < LookupTable.Count; i++)
                {
                    OutputString += num2hex(LookupTable[i].Item1.Gid) + num2hex(LookupTable[i].Item2.Gid) + num2hex(LookupTable[i].Item3.Gid) + num2hex(LookupTable[i].Item4.Gid);
                }

                //OutputString += "\",\nbgflip=\n{\n";
                OutputString += "\",\nbgflip=\"";

                Action<TmxLayerTile> ProcessTile = (TmxLayerTile Tile) =>
                {
                    System.Diagnostics.Debug.Assert(Tile.DiagonalFlip == false);
                    if (Tile.VerticalFlip == true ||
                       Tile.HorizontalFlip == true)
                    {
                    //OutputString += "[" + Tile.X + "]={[" + Tile.Y + "]={" + (Tile.HorizontalFlip || Tile.DiagonalFlip).ToString().ToLower() + "," + (Tile.VerticalFlip || Tile.DiagonalFlip).ToString().ToLower() + "}},\n";
                    int x = Tile.X;
                        if (Tile.HorizontalFlip)
                        {
                            x |= 0x800;
                        }
                        int y = Tile.Y;
                        if (Tile.VerticalFlip)
                        {
                            y |= 0x800;
                        }
                        OutputString += num2hex(x, 3) + num2hex(y, 3);
                    }
                };

                for (int i = 0; i < BackgroundLayer.Tiles.Count; i++)
                {
                    ProcessTile(BackgroundLayer.Tiles[i]);
                    //ProcessTile(LookupTable[i].Item1);
                    //ProcessTile(LookupTable[i].Item2);
                    //ProcessTile(LookupTable[i].Item3);
                    //ProcessTile(LookupTable[i].Item4);
                }

                //OutputString += "},\nobjs=\n{\n";
                OutputString += "\",\nobjs=\"";

                TmxLayer ObjectLayer = Map.Layers["Objects"];

                for (int i = 0; i < ObjectLayer.Tiles.Count; i++)
                {
                    TmxLayerTile Tile = ObjectLayer.Tiles[i];
                    if (Tile.Gid != 0)
                    {
                        //OutputString += "{" + Tile.X + "," + Tile.Y + "," + (Tile.Gid-1) + "},\n";
                        OutputString += num2hex(Tile.X, 3) + num2hex(Tile.Y, 3) + num2hex(Tile.Gid - 1);
                    }
                }

                OutputString += "\",\n";

                OutputString += "pipes={\n";

                //x,y,lvl,lvlx,lvly,dir
                foreach (TmxObject Obj in Map.ObjectGroups["Pipes"].Objects)
                {
                    OutputString += "{" + (Obj.X/8) + "," + (Obj.Y/8) + "," + Obj.Properties["dest_lvl"] + "," + Obj.Properties["dest_x"] + "," + Obj.Properties["dest_y"] + "," + Obj.Properties["dest_dir"] + "},\n";
                }

                OutputString += "},\n";

                //OutputString += "bgpal={\n";
                

                if (Map.ObjectGroups.Contains("Pals") && Map.ObjectGroups["Pals"].Objects.Count>0)
                {
                    OutputString += "bgpal=\"";
                    foreach (TmxObject Obj in Map.ObjectGroups["Pals"].Objects)
                    {
                        //OutputString += "{" + (Obj.X / 8) + "," + (Obj.Y / 8) + "," + (Obj.Width / 8) + "," + (Obj.Height / 8) + "," + Obj.Properties["pal"] + "},\n";
                        OutputString += num2hex((int)Obj.X/8,3) + num2hex((int)Obj.Y/8,2) + num2hex((int)Obj.Width/8,1) + num2hex((int)Obj.Height/8,1) + Obj.Properties["pal"];
                    }
                    OutputString += "\",\n";
                }
                
                //OutputString += "},\n";

                OutputString += "},\n";

            }

            OutputString += "}";

